import UserMapper from '../mapper/UserMapper'

export default class UserService {
    constructor(url) {
        this.url = url
    }

    async logUser() {
        const user = await fetch(this.url)
            .then((response) => response.json())
            .then((data) => UserMapper.convertToUser(data))
        return user
    }
}
